databaseChangeLog:
  - changeSet:
      id: 1
      author: charles
      changes:
        - createTable:
            tableName: rural_properties
            columns:
              - column:
                  name: id
                  type: BIGSERIAL
                  constraints:
                    primaryKey: true
              - column:
                  name: property_name
                  type: VARCHAR(255)
                  constraints:
                    nullable: false
              - column:
                  name: latitude
                  type: DOUBLE PRECISION
              - column:
                  name: longitude
                  type: DOUBLE PRECISION
              - column:
                  name: area_hectares
                  type: DOUBLE PRECISION

